import React from 'react';


class Cart extends React.Component{


    render(){
        return(
            <div className='cart'>
                <h3>Cart</h3>
                {this.props.cartItems.map((item,key)=>(
                    <h4>{item.item}</h4>
                ))}
            </div>
        )
    }

}


export default Cart;
